import React from 'react';
import {TextField} from '@material-ui/core';


const Title1 = {
    fontSize: '20px',
    color: '#008037',
    fontWeight: 'bold',
    marginLeft: '20px',
    justifyContent: 'center'
  }
  const Field = {
    marginLeft: '20px',
    flexDirection: 'left'
   
  }
const UsersUpdate = () => {
    return (
        <div>
       <div style={Title1}>
       <h2> Enter new Fields</h2>
       </div>
        <div style={Field}>
            <TextField
            label= "Enter firstname" />
             <TextField
            label= "Enter lastname" />
             <TextField
            label= "Enter mail" />
             <TextField
            label= "Enter phone" />
             <TextField
            label= "Enter age" />
             <TextField
            label= "Enter password" />
             <TextField
            label= "Enter city" />
            </div>
        </div>

    )
    
    };
  
  export default UsersUpdate;
